;; **
;;; The best random forest (that is, the one who got the smallest mean sqare error over the test set) was:
;; **

;; @@
(def best-forest-results
  (->> models-compared
     (filter (fn [model-results]
               (-> model-results
                   :training-parameters
                   :model-type
                   (= :forest))))
     first))

(view-model-results best-forest-results)
