;; **
;;; We can see how the original way of creating the data is reflected in the resulting tree.
;;; 
;;; Now, to see the diversity in a random forest, let us take pick some trees of the best random forest and view them.
;; **

;; @@
(->> best-forest-results
     :model
     (.getTrees)
     (take 3)
     (map view-tree))

